```javascript
"use strict";

function minimumCardPickup(cards) {
    let m = {};
    let ans = 10**6;
    for (let i = 0; i < cards.length; i++) {
        let c = cards[i];
        if (c in m) {
            ans = Math.min(ans, i - m[c] + 1);
        }
        m[c] = i;
    }
    return ans === 10**6 ? -1 : ans;
}
